import manageJss from "@microsoft/fast-jss-manager-react";
import { CallToActionStyles } from "@microsoft/fast-components-styles-msft";
import MSFTCallToAction, { CallToActionAppearance, } from "./call-to-action";
import callToActionSchema from "./call-to-action.schema";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const CallToAction = manageJss(CallToActionStyles)(MSFTCallToAction);
export { CallToAction, CallToActionAppearance, callToActionSchema, };
